INSERT INTO `test_active` (`id`,`name`,`content`,`lat`,`lng`,`wardid`,`streetid`,`addressnumber`,`addressnumber_old`,`streetid_old`,`price`,`width`,`height`,`acreage`,`pricerent`,`landarea`,`floorarea`,`structure`,`status`,`direction`,`basement`,`floor`,`living`,`bedroom`,`toilet`,`kitchen`,`advancedetruct`,`roadwidth`,`censorship`,`userid`,`userid_updated`,`created`,`modified`,`deletetime`,`parentid`) VALUES (143589,NULL,'Chị mình cần bán nhà Quận 3, hiện đang cho thuê 50 - 60 triệu / tháng\r\nĐịa chỉ: hẻm 18/82A Trần Quang Diệu, Phường 14, Quận 3, thành phố Hồ Chí Minh\r\nNhà thuộc trung tâm thành phố, vị trí đắc địa, gần chợ Nguyễn Văn Trỗi, Q3 , gần trường Đại học Tài Nguyên và Môi trường, cho thu nhập tốt hàng tháng mà vẫn đảm bảo vốn đầu tư luôn gia tăng.\r\nNhà có diện tích ngang 4,3m x 17,5m ( nở hậu 4,75m). Xây chắc chắn 1 trệt, 4 lầu, tổng cộng 18 phòng, toilet riêng từng phòng, đang cho thuê, thu nhập từ 50-60 triệu/tháng. Tỷ lệ full phòng từ 90- 100%. Có khu vực để xe máy riêng .\r\n* Vị trí : hẻm đối diện chợ Nguyễn Văn Trỗi, gần siêu thị, trường học từ mẫu giáo đến đại học, bệnh viện và các tiện ích công cộng. Nhà trọ ở ngay trung tâm tiện cho việc di chuyển, làm việc, học tập đến tất cả các quận.\r\n* Về An Ninh : do nằm gần UBND và công an phường nên an ninh rất tốt , có bảo vệ dân phố trực thường xuyên . Bên cạnh đó dãy trọ còn được trang bị hệ thống camera giám sát 24/24, giúp gia chủ quản lý được từ xa thông qua Smart phone và một bảo vệ riêng cho nhà trọ.\r\n* Pháp lý : sổ hồng riêng đã hoàn công đầy đủ\r\n* Thu nhập từ phòng trọ quá ok nhưng do cần tiền gấp, nên bán đại hạ giá: 12 tỷ .\r\nRất vui được tiếp khách có thiện ý mua, các báo đăng tin quảng cáo vui lòng đừng liên hệ',10.788181,106.679647,27127,129,'18/82A',NULL,NULL,12000000000,4.30,14.10,60.60,'50000000',NULL,307.20,3,1,0,NULL,5,NULL,18,NULL,NULL,NULL,NULL,3,243,NULL,'2021-02-19 09:11:57','2021-02-19 09:12:21',NULL,NULL);
